// components

//picture && styles
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faHeadset, faCreditCard, faHardHat } from '@fortawesome/free-solid-svg-icons'
import AppContext from "../../AppContext.js";
import { 
	Wrapper,
	Content,
	WelcomeMessage,
	IconWrapper,
	LoadAtHomePic,
	NewBikePic,
	Icon1,
	Icon2,
	Icon3
} from "./Form.styles.js";


export default function Home() {
    // get user by username
    //
    const myContext = useContext(AppContext);
	return (
		<Wrapper>
            <Content>


	{/* 			<EnvironmentPic> <img src={environment} alt="environment" width="25%" height="80%" />  </EnvironmentPic> 
				<LoadAtHomePic> <img src={loadathome} alt="Load at home" width="80%" height="100%" /> </LoadAtHomePic> 
				<NewBikePic> <img src={newbike} alt="New bike" width="100%" height="100%" /> </NewBikePic>  */}
				<LoadAtHomePic> 
					<WelcomeMessage> <h2>Välkommen {myContext.user.username}</h2> </WelcomeMessage>
					<IconWrapper>
						<Icon1> 
							<FontAwesomeIcon icon={faHardHat} size="2x" />  
							<h3>Var försiktig! tänk på din och andras säkerhet!</h3>
						</Icon1> 
						<Icon2> 
							<FontAwesomeIcon icon={faCreditCard} size="2x" />
							<h3>Enkla och säkra betalningsmöjligheter</h3>
						</Icon2>
						<Icon3> 
							<FontAwesomeIcon icon={faHeadset} size="2x" />
							<h3>Vår support och felanmälan har öppet 24/7.</h3>
						</Icon3>
					</IconWrapper>
				 </LoadAtHomePic> 
				<NewBikePic> 

				</NewBikePic> 
			</Content>
		</Wrapper>
	);
}
